import React from 'react';
import popCoinLogo from './assets/pop-coin.png';

const Header = ({ section, setSection }) => (
  <header>
    <nav>
      <h2>
        <img src={popCoinLogo} alt="PoP Coin Logo" />
        POP-COIN
      </h2>
      <div className="internal-links">
        <a href="#" className={section === 'home' ? 'active' : ''} onClick={() => setSection('home')}>Home</a>
        <a href="#" className={section === 'litepaper' ? 'active' : ''} onClick={() => setSection('litepaper')}>Litepaper</a>
        <a href="#" className={section === 'about' ? 'active' : ''} onClick={() => setSection('about')}>About</a>
      </div>
    </nav>
  </header>
);

export default Header;
